import React from "react";
import "./Register.css";

const Register = () => {
  return (
    <>
      <div className="register-form">
        <form>
          <input type="Firtst Name" placeholder="First Name" name="fname" />

          <input type="Middle Name" placeholder="Middle Name" name="mname" />

          <input type="Last Name" placeholder="Last Name" name="lname" />
        </form>
      </div>
    </>
  );
};

export default Register;
